import React, { useState, useEffect } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

const mockData = {
  status: "OK",
  venue_info: {
    venue_name: "Vasa Museum",
    venue_address: "Gal채rvarvsv채gen 14, 115 21 Stockholm, Sweden",
    venue_timezone: "Europe/Stockholm"
  },
  analysis: [
    { day_info: { day_text: "Monday" }, day_raw: [0,0,0,0,0,0,0,0,30,50,70,80,90,85,75,60,45,30,0,0,0,0,0,0] },
    { day_info: { day_text: "Tuesday" }, day_raw: [0,0,0,0,0,0,0,0,35,55,75,85,95,90,80,65,50,35,0,0,0,0,0,0] },
    { day_info: { day_text: "Wednesday" }, day_raw: [0,0,0,0,0,0,0,0,40,60,80,90,100,95,85,70,55,40,0,0,0,0,0,0] },
    { day_info: { day_text: "Thursday" }, day_raw: [0,0,0,0,0,0,0,0,45,65,85,95,100,100,90,75,60,45,0,0,0,0,0,0] },
    { day_info: { day_text: "Friday" }, day_raw: [0,0,0,0,0,0,0,0,50,70,90,100,100,100,95,80,65,50,0,0,0,0,0,0] },
    { day_info: { day_text: "Saturday" }, day_raw: [0,0,0,0,0,0,0,0,55,75,95,100,100,100,100,85,70,55,0,0,0,0,0,0] },
    { day_info: { day_text: "Sunday" }, day_raw: [0,0,0,0,0,0,0,0,60,80,100,100,100,100,100,90,75,60,0,0,0,0,0,0] }
  ]
};

const ResultsPage = () => {
  const [trafficData, setTrafficData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [usingMockData, setUsingMockData] = useState(false);
  const navigate = useNavigate();
  const location = useLocation();

  useEffect(() => {
    const searchParams = new URLSearchParams(location.search);
    const venueName = searchParams.get('name');
    const venueAddress = searchParams.get('address');

    if (!venueName || !venueAddress) {
      setError('Venue information is missing.');
      setLoading(false);
      return;
    }

    const fetchTrafficData = async () => {
      try {
        const apiKey = 'pri_070565f833f9459aad223978a7a19b74';
        const besttimeUrl = 'https://besttime.app/api/v1/forecasts';
        const params = new URLSearchParams({
          'api_key_private': apiKey,
          'venue_name': venueName,
          'venue_address': venueAddress
        });

        const response = await fetch(`${besttimeUrl}?${params}`, {
          method: 'POST'
        });

        if (!response.ok) {
          throw new Error(`HTTP error! status: ${response.status}`);
        }

        const data = await response.json();

        if (data.status !== 'OK') {
          throw new Error(data.message || 'Failed to fetch forecast data');
        }

        setTrafficData(data);
      } catch (err) {
        console.error('API Error:', err);
        setError(`Failed to fetch data: ${err.message}. Using mock data for demonstration.`);
        setTrafficData(mockData);
        setUsingMockData(true);
      } finally {
        setLoading(false);
      }
    };

    fetchTrafficData();
  }, [location.search]);

  const renderForecastChart = () => {
    if (!trafficData || !trafficData.analysis) return null;

    const chartData = trafficData.analysis.flatMap(day => 
      day.day_raw.map((value, hour) => ({
        day: day.day_info.day_text,
        hour: hour,
        traffic: value
      }))
    );

    return (
      <ResponsiveContainer width="100%" height={400}>
        <LineChart data={chartData}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="hour" label={{ value: 'Hour of Day', position: 'bottom' }} />
          <YAxis label={{ value: 'Foot Traffic', angle: -90, position: 'insideLeft' }} />
          <Tooltip content={<CustomTooltip />} />
          <Legend />
          {trafficData.analysis.map(day => (
            <Line 
              key={day.day_info.day_text} 
              type="monotone" 
              dataKey="traffic" 
              data={chartData.filter(d => d.day === day.day_info.day_text)}
              name={day.day_info.day_text} 
              stroke={`#${Math.floor(Math.random()*16777215).toString(16)}`} 
            />
          ))}
        </LineChart>
      </ResponsiveContainer>
    );
  };

  const CustomTooltip = ({ active, payload, label }) => {
    if (active && payload && payload.length) {
      const data = payload[0].payload;
      return (
        <div className="bg-white p-2 border border-gray-300 rounded shadow">
          <p>{`${data.day}, ${label}:00`}</p>
          <p className="font-bold">{`Foot Traffic: ${data.traffic}`}</p>
        </div>
      );
    }
    return null;
  };

  const renderVenueInfo = () => {
    if (!trafficData || !trafficData.venue_info) return null;

    const { venue_name, venue_address, venue_timezone } = trafficData.venue_info;

    return (
      <div className="mb-4">
        <h2 className="text-xl font-semibold mb-2">Venue Information</h2>
        <p><strong>Name:</strong> {venue_name}</p>
        <p><strong>Address:</strong> {venue_address}</p>
        <p><strong>Timezone:</strong> {venue_timezone}</p>
      </div>
    );
  };

  return (
    <div className="min-h-screen bg-gray-100 p-8">
      <div className="max-w-4xl mx-auto">
        <button
          onClick={() => navigate('/')}
          className="mb-6 text-blue-600 hover:text-blue-800"
        >
          &larr; Back to Search
        </button>

        {loading && (
          <div className="text-center text-gray-600">
            Loading traffic data...
          </div>
        )}

        {error && (
          <div className="text-center text-red-500 mb-4">
            <p>Error: {error}</p>
            {usingMockData && (
              <p className="mt-2">Using mock data for demonstration purposes.</p>
            )}
          </div>
        )}

        {trafficData && !loading && (
          <div className="bg-white rounded-lg shadow-md p-6">
            {renderVenueInfo()}
            <h2 className="text-xl font-semibold mb-4">Weekly Foot Traffic Forecast</h2>
            {renderForecastChart()}
            {usingMockData && (
              <p className="text-sm text-gray-500 mt-2">Note: This is mock data for demonstration purposes.</p>
            )}
          </div>
        )}

        <div className="mt-8 bg-gray-200 p-4 rounded">
          <h2 className="text-lg font-semibold mb-2">Debug Information</h2>
          <pre className="whitespace-pre-wrap overflow-auto max-h-96">
            {JSON.stringify({ trafficData, loading, error, usingMockData }, null, 2)}
          </pre>
        </div>
      </div>
    </div>
  );
};

export default ResultsPage;
